function fetchpoasts(o) {
	if(o == 'first') {
		$('.4chan_ext_thread_replies').data('poasts',0);
		setInterval(function(){ fetchpoasts(); },2500);
	}
	if($('.4chan_ext_thread_replies table').size()<125) {
		var ChanRequest = $.ajax({
			url: window.location.href,
			dataType: 'html',
			error: function() {
				if($('.404d').size()<1) {
					var DO = new Date();
					var time = (DO.getHours()>12?DO.getHours()-12:DO.getHours())+':'+DO.getMinutes()+(DO.getHours()>12?'pm':'am');
					var date = time+" "+DO.getDay()+"/"+DO.getMonth()+"/"+DO.getYear();
					$('.4chan_ext_thread_replies').append('<div class="404d" style="display: none; width: 400px; background: -moz-linear-gradient(center top , rgb(255, 238, 238), rgba(255, 0, 0, 0)); -moz-border-radius: 10px; margin: 10px; border: 1px solid #f00; color: #f00; padding: 20px; font-size: 40px;"><b>404\'d</b> at '+date+'</div>');
					$('.404d').slideDown(500);
				}
			},
			success: function(data) {
				var formdata = data.replace(/(\r\n|\r|\n)/g,'#BR//#');
				formdata = formdata.replace(/^(.*?)<form name="delform"(.*?)<\/form>(.*?)$/,'<form name="delform"$2</form>');
				formdata = formdata.replace(/^(.*?)<span class="filesize">(.*?)<\/blockquote>(.*?)$/,'$1$3');
				formdata = formdata.replace(/\#BR\/\/\#/g,"\n");
				if($(formdata).find('a[name]').size() > parseFloat($('.4chan_ext_thread_replies').data('poasts'))) {
					$(formdata).find('a[name]').each(function(){
						if($('.4chan_ext_thread_replies').find('table[poast=\''+($(this).attr('name'))+'\']').size()<1) {
							var poastID = $(this).attr('name');
							var newPoast = $(this).next().html();
							$('.4chan_ext_thread_replies').append('<table hiddenpoast="'+poastID+'" class="4chan_ext_reply_hidden" id="4chan_ext_reply_hidden_'+poastID+'" style="display:none;"><tr><td class="doubledash" valign="middle">&gt;&gt;</td><td class="reply hidden" width="400"><a href="javascript:showpost(\''+poastID+'\')">Show Post</a></td></tr></table>');
							$('.4chan_ext_thread_replies').append('\n<a name="'+poastID+'"></a>\n<table style="display:none;" id="4chan_ext_reply_'+poastID+'" class="4chan_ext_reply" poast="'+poastID+'">'+(newPoast)+'</table>\n');
							$('#norep'+poastID).after('<span><img onClick="reppop(\'http://boards.4chan.org/b/imgboard.php?mode=report&amp;no='+poastID+'\');" src="chrome://4chan/skin/buttons/futaba/stop.png" style="position: relative; top: 3px; cursor: pointer;" alt="" title="Report this post" id="4chan_ext_escalatebutton_'+poastID+'" class="4chan_ext_escalatebutton" border="0"><a href="#'+poastID+'"><img src="chrome://4chan/skin/buttons/futaba/arrow_up.png" style="position: relative; top: 3px; cursor: pointer;" alt="" title="To Thread Start" class="4chan_ext_tothreadstartbutton" border="0"></a><a href="javascript:hidepost(\''+poastID+'\')"><img src="data:image/png;base64," style="position: relative; top: 3px; cursor: pointer;" alt="" title="Hide Post" class="4chan_ext_tothreadstartbutton" border="0"></a></span>');
							$('#norep'+poastID).find('a.quotejs:contains(\'XXX\')').html(poastID);
							$('#4chan_ext_reply_'+poastID).find('a[target=\'_blank\'] img[md5]').attr('osrc',$('#4chan_ext_reply_'+poastID).find('a[target=\'_blank\'] img[md5]').attr('src'));
							$('#4chan_ext_reply_'+poastID).find('a[target=\'_blank\'] img[md5]').removeAttr('width');
							$('#4chan_ext_reply_'+poastID).find('a[target=\'_blank\'] img[md5]').removeAttr('height');
							$('#4chan_ext_reply_'+poastID).find('a[target=\'_blank\'] img[md5]').toggle(function(){
								$(this).attr('src',$(this).parent().attr('href'));
							},function(){
								$(this).attr('src',$(this).attr('osrc'));
							});
							$('#4chan_ext_reply_'+poastID).find('a[target=\'_blank\'] img[md5]').parent().click(function(){ return false; });
							setTimeout(function(){ $('#4chan_ext_reply_'+poastID).slideDown(500); },50);
						}
					});
				}
				$('.4chan_ext_thread_replies').data('poasts',$(formdata).find('a[name]').size());
			}
		});
	}
}
function jqloaded() {
	if($('.4chan_ext_thread_replies').size()>0) {
		$('body').append('<script type="text/javascript">function hidepost(poast){\
			document.getElementById(\'4chan_ext_reply_\'+poast+\'\').style.display = \'none\';\
			document.getElementById(\'4chan_ext_reply_hidden_\'+poast+\'\').style.display = \'block\';\
		}function showpost(poast){\
			document.getElementById(\'4chan_ext_reply_\'+poast+\'\').style.display = \'block\';\
			document.getElementById(\'4chan_ext_reply_hidden_\'+poast+\'\').style.display = \'none\';\
		}</script>');
		$('.4chan_ext_escalatebutton').each(function(){
			var PoastID = $(this).attr('id').split('_')[3];
			$(this).parent().append('<a href="javascript:hidepost(\''+PoastID+'\')"><img src="data:image/png;base64," style="position: relative; top: 3px; cursor: pointer;" alt="" title="Hide Post" class="4chan_ext_tothreadstartbutton" border="0"></a>');
		});
		$('.4chan_ext_reply').each(function(){
			var PoastID = $(this).attr('id').split('_')[3];
			$(this).before('<table hiddenpoast="'+PoastID+'" class="4chan_ext_reply_hidden" id="4chan_ext_reply_hidden_'+PoastID+'" style="display:none;"><tr><td class="doubledash" valign="middle">&gt;&gt;</td><td class="reply hidden" width="400"><a href="javascript:showpost(\''+PoastID+'\')">Show Post</a></td></tr></table>');
			$(this).attr('poast',PoastID);
			$(this).find('blockquote').attr('id','post_content_'+PoastID);
		});
		$('a.quotejs:contains(\'XXX\')').each(function(){
			var PoastID = $(this).attr('href').replace(/javascript\:quote\('(.*?)'\)/gi,'$1');
			$(this).html(PoastID);
		});
		fetchpoasts('first');
		$('.4chan_ext_thread_replies').after('<div id="visualform"><table><tr><td class="doubledash"><<</td><td class="reply">\
		<table width="400" border="0" cellpadding="0" cellspacing="10">\
			<tr class="hideonsubmit">\
				<td width="100"><b>Name</b></td>\
				<td>\
					<input style="width:60%;" type="text" value="'+$('.inputtext[name=\'name\']').val()+'" onkeyup="var vx=this.value;document.getElementsByName(\'name\').item(0).value=vx;" />\
					<input type="checkbox" onclick="if(this.checked){document.getElementsByName(\'email\').item(0).value=\'sage\';}else{document.getElementsByName(\'email\').item(0).value=\'\';}"> Sage\
				</td>\
			</tr>\
			<tr class="hideonsubmit">\
				<td width="100"><b>Captcha</b></td>\
				<td>\
					<script>setInterval(function(){document.getElementById(\'recaptcha_image_fk\').src=document.getElementById(\'recaptcha_image\').getElementsByTagName(\'img\').item(0).src;},250);</script>\
					<img id="recaptcha_image_fk" border="0" onclick="Recaptcha.reload (); document.getElementById(\'fkptcha\').value = \'\'; setTimeout(function(){ document.getElementById(\'fkptcha\').focus(); },200);" style="cursor:pointer;" />\
					<input type="text" id="fkptcha" style="width:100%;" onkeyup="document.getElementById(\'recaptcha_response_field\').value=this.value;" />\
				</td>\
			</tr>\
			<tr class="hideonsubmit">\
				<td width="100"><b>Comment</b></td>\
				<td><textarea id="fkchanbsigkjdn" style="width:100%;" rows="2" onkeyup="document.getElementsByName(\'com\').item(0).value=this.value;"></textarea></td>\
			</tr>\
			<tr class="hideonsubmit">\
				<td width="100"><b>File</b></td>\
				<td><input type="text" id="oflctnts" style="width:5px;" /></td>\
			</tr>\
			<tr>\
				<td width="100">&nbsp;</td>\
				<td><input type="button" value="     Submit     " onclick="document.getElementById(\'com_submit\').click(); document.getElementById(\'fkchanbsigkjdn\').value=\'\';" /></td>\
			</tr>\
		</table></td></tr></table></div>');
		$('body').append('<iframe id="PostChanIframeLulz" name="PostChanIframeLulz" style="display:none;" onload="var frm = this; var data = frm.contentWindow.document.body.innerHTML; if(data) { if(data.indexOf(\'Error: Upload failed.\')>-1) { alert(\'Upload failed.\'); frm.reset(); Recaptcha.reload (); document.getElementById(\'fkptcha\').value = \'\'; } else { frm.reset(); Recaptcha.reload (); document.getElementById(\'fkptcha\').value = \'\'; } } else { frm.reset(); Recaptcha.reload (); document.getElementById(\'fkptcha\').value = \'\'; }"></iframe>');
		$('form[name=\'post\']').attr('target','PostChanIframeLulz');
		$('body').append('<a name="bottom" id="bottom"></a>');
		$('input[name=\'upfile\']').parent().parent().addClass('dontremove');
		$('input[name=\'upfile\']').parent().parent().parent().find('tr:not(.dontremove)').hide();
		$('.dontremove .postblock').hide();
		setInterval(function(){ $('input[name=\'upfile\']').css({ position: 'absolute', top: $('#oflctnts').position().top-1, left: $('#oflctnts').position().left }); },50);
		// ==Begin Gallery View==
		$('.4chan_ext_thread').prepend('<a class="slideshow-button" href="javascript:;" onclick="document.getElementById(\'slideshow\').style.display=\'block\'; return false;"></a>');
		$('.slideshow-button').css({ position: 'absolute', top: '280px', right: '10px' });
		$('body').append('<div class="slideshow" id="slideshow" style="display:none;background:rgba(0,0,0,.75);text-align:center;position:fixed;top:0px;left:0px;width:100%;height:100%;"></div>');
		$('.slideshow').append('<a class="slideshow-left" href="javascript:;"></a><a class="slideshow-right" href="javascript:;"></a><img src="data:image/png;base64," />');
		$('.slideshow img').attr('src',$('img[md5]').eq(0).parent().attr('href'));
		$('.slideshow img').css({ cursor: 'pointer' });
		$('.slideshow img').attr('title','Click to close');
		$('.slideshow img').click(function(){ $('#slideshow').fadeOut(100); });
		var CurrentEQ = 0;
		$('.slideshow .slideshow-right').click(function(){
			if(CurrentEQ<($('img[md5]').size()-1)) {
				$('.slideshow img').remove();
				$('.slideshow').append('<img />');
				$('.slideshow img').attr('src',$('img[md5]').eq(CurrentEQ+1).parent().attr('href'));
				$('.slideshow img').css({ cursor: 'pointer' });
				$('.slideshow img').attr('title','Click to close');
				$('.slideshow img').click(function(){ $('#slideshow').fadeOut(100); });
				CurrentEQ ++;
			}
		});
		$('.slideshow .slideshow-left').click(function(){
			if(CurrentEQ>0) {
				$('.slideshow img').remove();
				$('.slideshow').append('<img />');
				$('.slideshow img').attr('src',$('img[md5]').eq(CurrentEQ-1).parent().attr('href'));
				CurrentEQ --;
			}
		});
		setTimeout(function(){ finapply(); },100);
	} else { return null; /*4chan extension not installed*/ }
}
